    (x, y, z) = (0, 0, 0)
    (X, Y, Z) = (0, 0, 0)
    while a % 2 != 0:
        a //= 2
        x += 1
    while a % 3 == 0:
        a //= 3
        y += 1
    while a % 5 == 0:
        a //= 5
        z += 1
    while b % 2 == 0:
        b //= 2
        X += 1
    while b % 3 == 0:
        b //= 3
        Y += 1
    while b % 5 == 0:
        b //= 5
        Z += 1
    if a != b:
        return -1
    return max(X, x) - min(X, x) + max(y, Y) - min(y, Y) + max(z, Z) - min(z, Z)

